const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://www.google.com/search?q=live+image+of+trees&oq=live+image+of+trees&aqs=chrome..69i57j33i160l3.5180j0j7&sourceid=chrome&ie=UTF-8#imgrc=dDdiv-DpvulJiM.',
  imageSize: 90,
};

export default function Profile() {
  return (
    <>
      <h1>{user.name}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </>
  );
}
